import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import "./App.css";

import {
  Clientes,
  Empleado,
  Recuadro,
  Search,
  ListaClientes,
  ListaProveedores,
  Modale,
  Login,
  Login1,
  Navbar,
} from "./components";

const App = () => {
  return (
    <div>
      <div className="gradient__bg padre">
        <Navbar1 />
        <div className="hijo">
          <ListaProveedores />
        </div>
      </div>
    </div>
  );
};

export default App;
